    public function getList()
    {
        $db = Vipcore_Db::factory('master');

        $fetchFields = array(
                'id',
                'consignee',
                'area_id',
                'address',
                'postcode',
                'mobile',
                'tel', 
                'is_common'
        );

        $select = $db->select()
        ->from('user_address', $fetchFields)
        ->where('user_id = ?', $this->_userId);

        $data = $db->fetchAll($select);

        foreach ($data as $key => $value) {
            $data[$key] = $this->_formatData($value);
        }
        return $data;
    }
    
    public function getData($id = null)
    {
        if (!$id) $id = $this->_getDefaultAddressId();
        
        if ($id) {
            $db = Vipcore_Db::factory('master');
            
            $fetchFields = array(
                'id', 
                'consignee', 
                'area_id', 
                'address', 
                'postcode', 
                'mobile', 
                'tel', 
                'is_common'
            );
            
            $select = $db->select()
                      ->from('user_address', $fetchFields)
                      ->where('user_id = ?', $this->_userId)
                      ->where('id = ?', $id);
            
            $data = $db->fetchRow($select);
            $data = $this->_formatData($data);
            return $data;
        }
        return false;
    }
    
    public function save($data, $id = null)
    {
        $db = Vipcore_Db::factory('master');
        
        if (!$id) {
            $select = $db->select()
            ->from('user_address', '(COUNT(*))')
            ->where('user_id = ?', $this->_userId);
            
            $check = $db->fetchOne($select);
            
            if ($check >= 5) {
                $this->_errorMsg = "最多设置5条地址信息！";
                return false;
            }
        }
        
        $consignee = !empty($data["consignee"]) ? $data["consignee"] : "";
        $areaId    = !empty($data["county"]) ? $data["county"] : "";
        $address   = !empty($data["address"]) ? $data["address"] : "";
        $postcode  = !empty($data["postcode"]) ? $data["postcode"] : "";
        $mobile    = !empty($data["mobile"]) ? $data["mobile"] : "";
        $tel       = !empty($data["tel"]) ? $data["tel"] : "";
        
        // 参数判断
        
        if (!$areaId) {
            $this->_errorMsg = "请选择省市！";
            return false;
        }
        if (!$address) {
            $this->_errorMsg = "请输入收货地址！";
            return false;
        }
        if (!$postcode) {
            $this->_errorMsg = "请输入邮政编码！";
            return false;
        }
        if (!$consignee) {
            $this->_errorMsg = "请输入正确的收货人姓名！";
            return false;
        }
        if (!$mobile && !$tel) {
            $this->_errorMsg = "固定电话和移动电话请至少填写一项！";
            return false;
        }
        $time = time();
        $data = array(
            "consignee"			=> $consignee,
            "area_id"			=> $areaId,
            "address"			=> $address,
            "postcode"			=> $postcode,
            "mobile"			=> $mobile,
            "tel"				=> $tel,
            "add_time"				=> $time
        );
        
        if ($id) {
            $db->update("user_address", $data, "id =?", $id);
        } else {
            $data["user_id"] = $this->_userId; 
            $db->insert("user_address", $data);
            $id = $db->insertID();
        }
        
        // 没有设置默认地址则系统自动设置
        $select = $db->select()
                  ->from('user_address', 'id')
                  ->where('user_id = ?', $this->_userId)
                  ->where('is_common = 1');
        $checkDefault = $db->fetchOne($select);
        
        if (!$checkDefault) {
            $this->setDefault($id);
        }
        
        $this->_saveCookie($id);
        
        return $id;
    }
    
