    /**
     * 根据地址编码获取地址全信息
     *
     * modified by Lifeng <feng03.li@vipshop.com>
     * Date: 2013-11-07
     * @link http://wiki.vipshop.com/pages/viewpage.action?pageId=13835742
     * @param string $areaId 地址编码
     * @return array|bool
     */
    public function _getAreaInfoFull($areaId)
    {
        $result = false;
        $addressApiUrl = 'http://' . DOMAIN_API_ADDRESS . '/index.php';
        $secretKey = 'ef2d5fe007s92fc565bdfe3b20s15j87';
        $requestParam = array(
            'api_key' => '74b2af1b97j9dd757210e3gda112ldd3',
            'ver' => '1.0.0',
            'vipcore_c' => 'address',
            'vipcore_a' => 'getAddrInfo',
            'areaid' => $areaId,
        );

        //生成签名字符串(注意：拼接字符串的顺序需要按照所传参数的数组下标排序拼接，最后再拼接私有密钥)
        $requestParam['api_sign'] = md5($requestParam['api_key'] . $requestParam['areaid'] . $requestParam['ver'] . $secretKey);

        $url = $addressApiUrl . '?' . http_build_query($requestParam);

        $ch = curl_init();
        curl_setopt($ch, CURLOPT_URL, $url);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
        curl_setopt($ch, CURLOPT_CONNECTTIMEOUT, 2);
        curl_setopt($ch, CURLOPT_TIMEOUT, 4);
        $content = curl_exec($ch);

        if (curl_errno($ch)) {
            $this->_errorMsg = curl_error($ch);
        } else {
            $data = json_decode($content, true);
            if (!empty($data['code']) &&  $data['code'] == 200) {
                $result = array('urlAreaCode' => $data['result']);
            } else {
                $this->_errorMsg = empty($data['msg']) ? "WRONG AREA CODE!" : $data['msg'];
            }
        }

        curl_close($ch);
        return $result;
    }

    function _getFreightMen($addr_id,$update=false){
    
    	if($addr_id=='')
    		return array();
    	$output = false;
    	$memcache = Vipcore_Cache::factory('memcache');
    	$table_address = "transport_freight";
    	$arr_freight_info = array();
    	$freight_key = $this->get_key_prefix('freight').$addr_id;
    	// $memcache->delete($freight_key,0);
    	if (!$update) {
    		$output = $memcache->get($freight_key);
    	}
    	if(empty($output['code'])){
    	    $db = Vipcore_Db::factory('master');
    
    		$fetchFields = array(
    				'code',
    				'name',
    				'full_name',
    				'parent_code',
    				'has_children',
    				'is_directly',
    				'is_cod',
    				'cod_fee',
    				'postage',
    				'is_service',
    				'is_ems',
    				'big_money',
    				'state',
    				'post_code',
    				'more_carrier',
    				'carrier_name',
    				'delivery',
    				'warehouse'
    		);
    		$select = $db->select()
    		->from('transport_freight', $fetchFields)
    		->where('code = ?', $addr_id)
    		->where('state = 1');
    		$output = $db->fetchRow($select);
    		// 将获取的结果根据数据库键值对存入到数组中
			$memcache->delete($freight_key);
    		$memcache->set($freight_key, $output, false, 2592000);
    	}
    	return $output;
    
    }
    
    function _getAreaInfoFulls($areaid,$field="") {
    
    	if (strlen($areaid)>12) {
    		$areaid = substr($areaid, 12);
    	}
    	$areaInfo   = $this->_getFreightMen($areaid);
    
    	if(!empty($field)){      //只返回对应字段
    		return isset($areaInfo[$field]) ? $areaInfo[$field] : $areaInfo;
    	}else{
    		return $areaInfo;
    	}
    
    }
    function get_key_prefix ($key) {
    	$key_prefix = array(
    			"province"=>"tms_province",
    			"city"=>"tms_city_",
    			"county"=>"tms_county_",
    			"street"=>"tms_street_",
    			"freight"=>"tms_addr_info_",
    	);
    	return $key_prefix[$key];
    }
    private function _formatData($data)
    {
      $area_info_full = $this->_getAreaInfoFulls($data['area_id']);
        $data["code"] = $area_info_full['code'];
        $data["name"] = $area_info_full['name'];
        $data["parent_code"] = $area_info_full['parent_code'];
        $data["has_children"] = $area_info_full['has_children'];
        $data["is_directly"] = $area_info_full['is_directly'];
        $data["carrier_name"] = $area_info_full['carrier_name'];
        $data["more_carrier"] = $area_info_full['more_carrier'];
        $data["area_name"] = $area_info_full['full_name'];
        $data["postcode"] = $area_info_full['post_code'];
        $data["shipping_fee"] = $area_info_full['postage'];
        //是否支持货到付款
        $data["is_cod"] = $area_info_full['is_cod'];
        $data["is_service"] = $area_info_full['is_service'];
        $data["is_ems"] = $area_info_full['is_ems'];
        $data["state"] = $area_info_full['state'];
        $data["carrier_name"] = $area_info_full['carrier_name'];
        $data["delivery"] = $area_info_full['delivery'];
        $data["warehouse"] = $area_info_full['warehouse'];
        $data["tel"] = preg_replace("/^\-/", '', $data["tel"]);
        // $data["is_cod"] = $this->isCod($data["area_id"]);
        $areaIdStr = substr($data["area_id"],0,1);
        if ($areaIdStr == 9) {
            $areaId=$data["parent_code"];
        } else {
            $areaId=$data["area_id"];
        }
        $data['shipping_fee'] = self::getShippingFee($areaId);
        
        if ($data['is_common']) {
            if (empty($data['postcode'])||
                    !is_numeric($data['area_id']) ||
                    empty($data['area_id']) ||
                    empty($data['consignee']) ||
                    empty($data['address']) ||
                    (empty($data['mobile']) && empty($data['tel']))
            ) {
                $data['is_common'] = 0;
            }
        }
        
        return $data;
    }
    
    private function _getAreaName($areaId, $link='')
    {
        $pv = $cy = $cu = '';
        $len = strlen($areaId);
        if ($len >= 6)
            $pv = self::buildAddress(substr($areaId, 0, 6), 0);
        if ($len >= 9)
            $cy = self::buildAddress(substr($areaId, 0, 9), 0);
        if ($len == 12)
            $cu = self::buildAddress($areaId, 0);
        
        return $pv.$link.$cy.$link.$cu;
    }
    
    static public function buildAddress($addressinput)
    {
        $strlen = strlen($addressinput);
        if ($strlen == 6) {
            $province = self::$province;
            $find = array_search($addressinput, $province);
            $findStr = $province[$find+1];
            return $findStr;
        }
        
        if ($strlen == 9) {
            $city = self::$city;
            $key = substr($addressinput, 0, 6);
            $find = @array_search($addressinput, $city[$key]);
            $findStr = $city[$key][$find+1];
            return $findStr;
        }
        
        if ($strlen == 12) {
            $county = self::$county;
            $key = substr($addressinput, 0, 9);
            $find = @array_search($addressinput, $county[$key]);
            $findStr = $county[$key][$find+1];
            return $findStr;
        }
        return false;
    }
    
    
    
